import React, { Component } from 'react';
import styles from './Users.module.css'

class users extends Component {

    state = {
        userList: [],
        pgLoad: false
    }

    componentDidMount() {
        fetch('https://gorest.co.in/public-api/users')
            .then(resp => resp.json())
            .then(json => {
                this.setState({
                    pgLoad: true,
                    userList: json,
                })
            });
    }




    render(){
        return(
            <div className={styles.users}>
                <h1>Users List</h1>
                <div className={styles.userProfile}>
                    <img alt='user profile' src='https://w0.pngwave.com/png/613/636/computer-icons-user-profile-male-avatar-avatar-png-clip-art.png' />
                    <h3>User Name</h3>
                    <p>Phone No: 0092 300 000 0000</p>
                    <p>Emai: example.check@email.com</p>
                </div>
            </div>
        )
    }
}

export default users;
